properties.description:
Specifies if the total values should be displayed in the group headers or on bottom of the row. Does not affect the total sum.

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the <code>rows</code> aggregation is done.

Example: <pre>
  oTable.bindRows({
    path: "...",
    parameters: {
      sumOnTop: true
    }
  });
</pre>

Number of levels, which should be opened initially (on first load of data).

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the <code>rows</code> aggregation is done.

Example: <pre>
  oTable.bindRows({
    path: "...",
    parameters: {
      numberOfExpandedLevels: 1
    }
  });
</pre>

The kind of auto expansion algorithm, e.g. optimized filter conditions, per level requests, ... Must be a value of <code>sap.ui.table.TreeAutoExpandMode</code>.

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the <code>rows</code> aggregation is done.

Example: <pre>
  oTable.bindRows({
    path: "...",
    parameters: {
      autoExpandMode: "Bundled"
    }
  });
</pre>

